export const NotFound = () => {
  return (
    <div id="message">
      <h2>404</h2>
      <h1>Страница не найдена</h1>
      <p>
        Указанный файл не был найден на этом веб-сайте. Пожалуйста, проверьте
        URL на ошибки и попробуйте еще раз.
      </p>
    </div>
  );
};
